// src/commands/wallet/deposit.ts
var import_qrcode_terminal = __toESM(require_main2(), 1);
async function depositToWallet(mintUrl, amount, unit) {
  const wallets = walletService.wallets;
  let wallet;
  if (wallets.length === 1) {
    wallet = wallets[0];
  } else if (wallets.length > 1) {
    const { selection } = await lib_default.prompt([
      {
        type: "list",
        name: "selection",
        message: "Select a wallet to deposit to:",
        choices: wallets.filter((w) => w instanceof NDKCashuWallet).map((w) => `${w.name ?? "Unnamed"} (${w.event.encode()})`),
        validate: (input) => {
          if (!input) {
            return "You must select a wallet.";
          }
          return true;
        }
      }
    ]);
    console.log({ selection });
    wallet = wallets.find((w) => w instanceof NDKCashuWallet && selection.includes(w.event.encode()));
  }
  if (!wallet) {
    console.log("No wallet selected.");
    return;
  }
  let mint;
  if (mintUrl) {
    mint = mintUrl;
  } else {
    const { selectedMint } = await lib_default.prompt([
      {
        type: "list",
        name: "selectedMint",
        choices: wallet.mints,
        message: "Select the mint to deposit to:"
      }
    ]);
    mint = selectedMint;
  }
  if (!amount || !unit) {
    const answers = await lib_default.prompt([
      {
        type: "input",
        name: "amount",
        message: "Enter the amount to deposit:",
        when: !amount
      },
      {
        type: "input",
        name: "unit",
        message: "Enter the unit for the amount:",
        default: wallet.unit,
        when: !unit
      }
    ]);
    amount = amount || answers.amount;
    unit = unit || answers.unit;
  }
  const deposit = await wallet.deposit(amount, mint, unit);
  const pr = await deposit.start();
  console.log(`Payment Request from ${mint}:`);
  console.log(`\x1B[1;37m${pr}\x1B[0m`);
  import_qrcode_terminal.default.generate(pr, { small: true }, (qrcode2) => {
    console.log(qrcode2);
  });
  await new Promise((resolve) => {
    deposit.on("success", (token) => {
      console.log(`Deposit successful: ${token.id}`);
      resolve(token);
    });
    deposit.on("error", (error) => {
      console.error(`Deposit failed: ${error}`);
      resolve(error);
    });
  });
}

